import Sidebar from '../components/Sidebar';

export default function Attendance() {
  return (
    <div className="main">
      <Sidebar />
      <div className="content">
        <h2>Attendance Page</h2>
        <p>HTML - 100%</p>
        <p>CSS - 80%</p>
        <p>JavaScript - 75%</p>
        <p>Node.js - 25%</p>
        <p>React.js - 50%</p>
        <p>MySQL - 65%</p>
      </div>
    </div>
  );
}
